INSERT INTO `property` VALUES (1,'Appartement Lille','A proximité de l\'arrêt de métro Lille Grand Palais et des commerces. Exposé Sud/Est il se compose d\'un grand séjour avec cuisine ouverte de 30m² qui donne sur un petit balcon avec vue panoramique sur la métropole lilloise, de trois chambres, une salle de bain et de toilettes séparées. Une place de parking vient compléter l\'ensemble. Les charges de copropriétés sont de 177euros/ mois et la taxe foncière est de 1439euros/an.',84,4,3,2,253000,0,'Lille','Lille Grand Palais, Lille, Hauts-de-France, France','59033',0,'2021-06-26 15:03:53','2021-06-26 15:03:53',50.6297,3.07492),(2,'Achat appartement Lille','Dans l\'une des rues les plus prisées du VIEUX-LILLE ! A deux pas de la place du Concert, au dernier étage d\'un immeuble de caractère ! Venez découvrir cet appartement en duplex de Type 3, lumineux avec cachet conservé. Il est composé d\'un beau séjour, cuisine ouverte, grande chambre avec salle de bains. Au niveau supérieur, une suite parentale avec dressing. Une place de parking dans la résidence complète ce bien ! Bien très rare sur le secteur !! À visiter rapidement ! Dont 5.93 % honoraires TTC à la charge de l\'acquéreur. Copropriété de 6 lots (Pas de procédure en cours). Charges annuelles: 2400.00 euros.',81,3,2,2,429000,0,'Lille','Mairie de Quartier Vieux-Lille, Lille, Hauts-de-France, France','59000',0,'2021-06-26 15:30:45','2021-06-26 15:30:45',50.6443,3.05997),(3,'Achat appartement Lille','appartement de Type 1 de 27 m² situé à côté de l\'université Catholique de Lille. A l\'entrée un espace de rangement, un séjour avec une cuisine ouverte, un WC séparé et une salle de bain. Idéal pour une location étudiante. A saisir sans tarder. Prix 179 800 euros Frais d\'agence inclus',27,1,1,3,179800,0,'Lille','Mairie de Quartier de Lille-Sud, Lille, Hauts-de-France, France','59000',0,'2021-06-26 15:32:41','2021-06-26 15:32:41',50.6129,3.0479),(4,'Achat appartement','L\'appartement comprend, un beau hall d\'entrée avec rangements, un grand séjour de 32m² donnant accès au balcon avec une superbe vue sur le parc, une cuisine équipée de 15m² et un WC avec meuble vasque. A l\'étage, 3 belles chambres dont une de 13m², une grande salle de bain avec double vasque et un WC séparé. Un box de parking fermé, une place de stationnement extérieure et une cave viennent completer ce bien !!',105,5,3,2,365000,1,'Lille','Mairie du Quartier Vauban-Esquermes, Lille, Hauts-de-France, France','59000',0,'2021-06-26 15:34:49','2021-06-26 15:34:49',50.6339,3.04073),(5,'Achat maison / villa','Maison louée, située à l\'arrière d\'un bel immeuble.\r\n\r\nCe bien est composé d\'un salon/séjour avec une kitchenette ouverte ainsi qu\'une chambre et une salle de bain à l\'étage.\r\n\r\nBail de 3 ans renouvelé en 2021 / loyer : 442 euros HC + 50 euros de charges.',36,2,1,1,120000,1,'Lille','Mairie de Quartier de Wazemmes, Lille, Hauts-de-France, France','59000',0,'2021-06-26 15:36:47','2021-06-26 15:36:47',50.6249,3.05069),(6,'Achat maison / villa','Lille maison 1930 de 118m² hab 3 chambres + bureau. Vaste séjour lumineux de 45m². Chauffage au gaz. Grande salle de bain. Prévoir rénovation intérieure. Cette maison ne possède pas d\"extérieur. Idéal colocation !',118,5,3,2,299000,1,'Lille','Lille, Hauts-de-France, France','59000',0,'2021-06-26 15:38:15','2021-06-26 15:38:15',50.632,3.05749),(7,'Achat maison / villa','Amateurs de charme et d\'espace cette maison est pour vous !. Large 1930 entièrement rénovée avec un mélange d\'ancien et de moderne, cette maison ravira la famille.. Magnifique cuisine équipée donnant sur un extérieur bien aménagé, une suite parentale au rez de chaussée et un beau salon parqueté ne manqueront pas de vous séduire.. Les étages vous offrent une salle de bains, 5 chambres et une terrasse suspendue.. Un grand garage vient compléter cette maison familiale qui vous séduira à coup sur.',203,7,6,2,786750,0,'Lille','Bois Blancs, Lille, Hauts-de-France, France','59130',0,'2021-06-26 15:41:38','2021-06-26 15:41:38',50.6345,3.03044),(8,'Achat maison / villa','Lille Bois Blancs.. . Magnifique maison de plus de 230 m² habitables, actuellement divisée en 3 appartements loués. . La maison offre ainsi de nombreuses possibilités :. Habitation unique avec bureau, 8 chambres, 3 salles d\'eau, jardin, garage.. Habitation avec possibilité de louer 1 ou 2 appartements (70m² et 42m²). . La maison a gardé le charme de l\'ancien parquet, portes travaillées.. . Venez la voir vous serez séduits !! 661350 euros Honoraires à la charge du vendeur.',237,9,8,3,661350,1,'Lille','Bois Blancs, Lille, Hauts-de-France, France','59130',0,'2021-06-26 15:43:06','2021-06-26 15:43:06',50.6345,3.03044),(9,'Achat maison / villa','Sur Amiens entre Parc St Pierre et Centre ville. Rare et Belle maison de type amiénoise de 141m² habitable avec terrasse bois (54m²).\r\n\r\nRénovée avec goût et matériaux de qualité, cette maison mélange moderne et ancien.',141,6,4,1,391000,1,'Amiens','Rue Saint-Leu, Amiens, Hauts-de-France, France','80000',0,'2021-06-26 15:46:13','2021-06-26 15:46:13',49.8988,2.3007),(110,'odio sed commodi','Dolorem sed ea ea sed quaerat. Sint nemo et quos unde porro necessitatibus dolorem. Esse rerum non aut sit vero error non porro.',169,6,8,8,118608,1,'Meyer','61, avenue David Fleury\n80271 Lagarde','87 038',0,'2021-06-26 15:53:27','2021-06-26 15:53:27',-19.684827,77.873202),(111,'aut quidem officia','Vel qui maiores dolorem tempore. Ea quo itaque at quo consequuntur. Quia et quidem molestiae non minus.',234,6,7,14,403512,0,'Pasquier','8, rue Petit\n55667 Dubois','62597',0,'2021-06-26 15:53:27','2021-06-26 15:53:27',9.350669,179.017365),(112,'dolore voluptas vel','Ipsa iste repellat totam vero illo et odio. Dolorem nihil nam animi soluta enim eos quasi tempora. Aut nisi autem fugiat delectus voluptatem rerum perferendis quam.',272,2,3,7,929837,1,'Guillaume','932, rue de Barbe\n79514 Legendre','80449',0,'2021-06-26 15:53:27','2021-06-26 15:53:27',4.026918,161.137706),(11